import React from "react";

const Button = (props) => {
  return (
    <div className="col-6 col-sm-3">
      <button
        type="button"
        class="d-none d-sm-block btn btn-dark mx-3 btn-lg btn-block"
      >
        {props.titulo}
      </button>
      <button
        type="button"
        class="d-sm-none btn btn-dark my-3 btn-sm btn-block"
      >
        {props.titulo}
      </button>
    </div>
  );
};

export default Button;
